import React from 'react'

function NewEventCard(props) {
    
    React.useEffect(()=>{
        window.$('.cd100').countdown100({
            endtimeYear: 2021,
            endtimeMonth: 8,
            endtimeDate: 29,
            endtimeHours: 10,
            endtimeMinutes: 0,
            endtimeSeconds: 0,
            timeZone: "Asia/Kolkata"
        })
    },[])
    return (
            <div class="cd100" style={{display: 'flex',marginLeft:'auto',marginRight:'auto'}} />
    );
}
export default NewEventCard
